import { Injectable } from '@angular/core';
import {Subject} from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class AuthService {

  loginStatus = new Subject();

  constructor() { }

  login(status:boolean){
    this.loginStatus.next(status);
  }

}
